import logo from './logo.svg';
import './App.css';

import CoinData from './MOCK_DATA.json';

function App() {
  return (
    <div className="App">
        ...search youir coin...
      <br /><br />
      {
        CoinData.map( coin => {
          return(
            <div className='Box'>
              <img src={ coin.image } alt={coin.token_name} key={ coin.id } /> <br />
              <div className='Title'>{ coin.token_name }</div>
              <div className='Text'>Price : { coin.token_price }</div>
              { coin.created_time } <br />
            </div>
          )
        }
        )
      }
    </div>
  );
}

export default App;
